import React from "react";

function InputForm({ id, name, type, handleOnChange }) {
    setProject({
        ...project,
        [e.target.name]: e.target.value,
      });

  return (
    <Input
      id={id}
      name={name}
      type={type}
      aria-describedby="my-helper-text"
      onChange={handleChange}
    />
  );
}

export default InputForm;
